import React, { useState } from "react";
import { Routes, Route } from "react-router-dom";
import Signin from "./Login/Signin";
import Signup from "./Login/Signup";
import Home from "./Home/Home";
import Profile from "./Home/EditProfile";
import Product from "./Home/Product";
import Package from "./Home/Package";
import Rental from "./Home/Rental";
import Packages from "./Home/Packages";
import Address from "./Home/Address";
import Create from "./Home/Create";
import CreateProduct from "./Home/CreateProduct";
import Cart from "./Home/Cart";
import AddAdress from "./Home/AddAddress";
import ProductCart from "./Home/ProductCart";
import Header from "./Header/Header"

function App() {

  const [Combo] = useState([]);

  return (
    <div>
      <Routes>
        <Route path="/" element={<Signin />}></Route>
        <Route path="/signup" element={<Signup />}></Route>
        <Route path="/home" element={<Home />}></Route>
        <Route path="/home/package" element={<Package Combo={Combo} />}></Route>
        {/* <Route path="/home/product" element={<Product />}></Route>
        <Route path="/home/packages" element={<Packages Combo={Combo} />}></Route>
